import styled from 'styled-components';

function PageNotFound() {
    return (
        <Container>
            <h1>
                404 -
                <strong> this page could not be found.</strong>
            </h1>
        </Container>
    )
}

export default PageNotFound;

const Container = styled.div`
    display: flex;
    flex-direction: row;

    > h1 {
        margin: 10px;
        font-weight: 400;
        margin-left: auto;
        margin-right: auto;
        margin-top: 150px;
    }

    > h1 > strong {
        font-weight: 600;
    }
`;
